import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class pagenotfound extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        return (
            <div>
                <h1>404</h1> 
                <h2>Page Not Found</h2> 
            </div>
        )
    }
}
